35 \u0432 \u0442\u0443\u0430\u043B\u0435\u0442\u0435 \u043C\u0438\u043D\u0443\u0442 \u043D\u0430 10. \u0417\u043D\u0430\u043A\u043E\u043C\u044B\u0435 \u0435\u043B\u0435 \u0441\u043E\u0433\u043B\u0430\u0441\u0438\u043B\u0438\u0441\u044C \u0438 \u0437\u043D\u0430\u043B\u0438, \u0447\u0442\u043E \u044D\u0442\u043E \u0445\u043E\u0440\u043E\u0448\u0438\u043C \u043D\u0435 \u0437\u0430\u043A\u043E\u043D\u0447\u0438\u0442\u0441\u044F. \u041F\u043E\u044D\u0442\u043E\u043C\u0443 \u0440\u0435\u0448\u0438\u043B\u0438 \u043F\u043E\u0448\u0443\u0442\u0438\u0442\u044C \"\u043F\u043E\u043B\u0435\u0433\u0447\u0435\". \u041E\u043D\u0438 \u043D\u0435 \u0437\u0430\u043A\u0440\u043E\u044E\u0442 \u0435\u0435 \u0432 \u0442\u0443\u0430\u043B\u0435\u0442\u0435, \u0430 \u043F\u0440\u043E\u0441\u0442\u043E \u043F\u043E\u043C\u0435\u043D\u044F\u044E\u0442 \u0442\u0430\u0431\u043B\u0438\u0447\u043A\u0438. \u0414\u0435\u043B\u043E \u0432 \u0442\u043E\u043C, \u0447\u0442\u043E \u043D\u0430 \u043E\u0434\u043D\u043E\u0439 \u043A\u0430\u0431\u0438\u043D\u043A\u0435 \u0431\u044B\u043B\u043E \u043D\u0430\u043F\u0438\u0441\u0430\u043D\u043E \"\u041D\u0430 \u0440\u0435\u043C\u043E\u043D\u0442\". \u0417\u043D\u0430\u043A\u043E\u043C\u044B\u0435 \u0434\u0435\u0432\u0443\u0448\u043A\u0438 \u0437\u043D\u0430\u043B\u0438, \u0447\u0442\u043E \u0442\u0443\u0434\u0430 \u0432\u043E\u0439\u0434\u0435\u0442 \u0440\u0435\u043C\u043E\u043D\u0442\u043D\u0438\u043A \u0438 \u0434\u0435\u0432\u0443\u0448\u043A\u0430 \u0441 \u043D\u0438\u043C \u0441\u0442\u043E\u043B\u043A\u043D\u0435\u0442\u0441\u044F. \u041D\u043E \u043E\u043D\u0438 \u043E\u0448\u0438\u0431\u043B\u0438\u0441\u044C, \u0431\u044B\u043B\u0430 \u0441\u043B\u043E\u043C\u0430\u043D\u0430 \u0440\u0430\u043A\u043E\u0432\u0438\u043D\u0430. \u0420\u0435\u043C\u043E\u043D\u0442\u043D\u0438\u043A \u0432\u043E\u0448\u0435\u043B \u043D\u0435 \u0432 \u043A\u0430\u0431\u0438\u043D\u043A\u0443, \u0430 \u0432 \u043A\u043E\u043C\u043D\u0430\u0442\u0443, \u0431\u043B\u0430\u0433\u043E\u0434\u0430\u0440\u044F \u043A\u043E\u0442\u043E\u0440\u043E\u0439 \u0432\u043E\u0434\u0430 \u0432 \u043A\u0430\u0444\u0435\u0448\u043A\u0435 \u043C\u043E\u0433\u043B\u0430, \u0442\u0430\u043A \u0441\u043A\u0430\u0437\u0430\u0442\u044C, \"\u0446\u0438\u0440\u043A\u0443\u043B\u0438\u0440\u043E\u0432\u0430\u0442\u044C\" \u043F\u043E \u0432\u0441\u0435\u0439 \u0437\u0430\u0431\u0435\u0433\u0430\u043B\u043E\u0432\u043A\u0435. \u0420\u0435\u043C\u043E\u043D\u0442\u043D\u0438\u043A \u043D\u0430\u0447\u0430\u043B \u0440\u0430\u0431\u043E\u0442\u0430\u0442\u044C. \u041D\u043E \u0432\u043E\u0442 \u0442\u0440\u0443\u0431\u0430 \u0441 \u043A\u0438\u043F\u044F\u0442\u043A\u043E\u043C \u0441\u043B\u043E\u043C\u0430\u043B\u0430\u0441\u044C - \u0435\u0435 \u043F\u0440\u043E\u0440\u0432\u0430\u043B\u043E! \u041E\u0442\u0440\u0430\u0437\u0438\u043B\u043E\u0441\u044C \u044D\u0442\u043E \u0438 \u043D\u0430 \u0440\u0430\u043A\u043E\u0432\u0438\u043D\u0435. \u0418\u0437 \u043D\u0435\u0435 \u043F\u043E\u043B\u0438\u043B\u0430\u0441\u044C \u043D\u0430\u043F\u043E\u0440\u043E\u043C \u0433\u043E\u0440\u044F\u0447\u0430\u044F \u0432\u043E\u0434\u0430. \u0412\u043E\u0442 \u043A\u043E\u043C\u043D\u0430\u0442\u0443 \u0443\u0436\u0435 \u043D\u0430\u0447\u0430\u043B\u043E \u0437\u0430\u0442\u043E\u043F\u043B\u044F\u0442\u044C. \"\u0414\u0440\u0443\u0437\u044C\u044F\" \u0443\u0441\u043B\u044B\u0448\u0430\u043B\u0438 \u043A\u0440\u0438\u043A\u0438 \u0438 \u043F\u043E\u0434\u0443\u043C\u0430\u043B\u0438, \u0447\u0442\u043E \u043A \u0434\u0435\u0432\u0443\u0448\u043A\u0435 \u043F\u0440\u043E\u0441\u0442\u043E \u0432\u043E\u0448\u0435\u043B \u0440\u0435\u043C\u043E\u043D\u0442\u043D\u0438\u043A. \u041E\u043D\u0438 \u043D\u0430\u0447\u0430\u043B\u0438 \u0441\u043C\u0435\u044F\u0442\u044C\u0441\u044F. \u041D\u043E \u043A\u043E\u0433\u0434\u0430 \u043F\u0440\u0438\u0448\u043B\u0438 \u0447\u0435\u0440\u0435\u0437 \u043F\u044F\u0442\u044C \u043C\u0438\u043D\u0443\u0442, \u0442\u043E \u0443\u0                     case 'sticker':
                        resultHtml += '<img src="' + attachment.sticker.photo64 + '" width="64" height="64">';
                        break;
                    case 'gift':
                        resultHtml += '<img src="' + attachment.gift.thumb96 + '" width="64" height="64">';
                        break;
                    case 'audio':

                        break;
                    case 'doc':
                        switch (attachment.doc.type) {

                                break;
                        }
                        break;

                        break;
                }
            });
            return resultHtml;
        } else return '';
